ISLAMABAD, Dec 11 (APP):The UK High Commissioner, Jane Marriot Wednesday called on Deputy Prime Minister and Foreign Minister, Senator Mohammad Ishaq Dar, both the dignitaries reaffirmed commitment to further enhance bilateral cooperation between Pakistan and the United Kingdom.
The dignitaries also discussed bilateral relations and regional developments, a Foreign Office news release said.
